import axios from 'axios'
// import { config as dotenv } from 'dotenv'

axios.create({
    baseURL: `http://localhost:5000`,
    headers: {
        "Content-type": "application/json"
    }
})

export default class Api {

    constructor() {
    }

    index = async () => {
        const data = await axios.get('/index')
        console.log(data)
    }
}
